import React from 'react';
import './App.css';

function App() {
	return (
		<div className="App">
			<header>
				<h1>Soomin<br/>Chung</h1>
				<nav>
					<a>Work</a>
					<a>Play</a>
					<a>About</a>
				</nav>
			</header>
			<main>
				<div></div>
			</main>
		</div>
	);
}

export default App;
